import React from 'react'
import Modal from 'react-modal';
import SubscribePopupComponent from '../performer/SubscribePopupComponent';
import PopupComponent from '../popup/PopupComponent';

class LockComponent extends React.Component {
    constructor() {
        super();
        this.state = {
            modalIsOpen: false
        };

        this.handleOpenModal = this.handleOpenModal.bind(this);
        this.handleCloseModal = this.handleCloseModal.bind(this);
    }
    handleOpenModal () {
        this.setState({ modalIsOpen: true });
    }

    handleCloseModal () {
        this.setState({ modalIsOpen: false });
    }
    // componentDidMount() {
    //     this.setState({modalIsOpen: true})
    // }
    setClientToken = () => this.setState({clientToken: ''})

    lockRender() {
        return(
            <div>
                <span className="tooltiptext">Inpremium, subscribe to view & purchase</span>
                <div className="lock-video">
                    <a href="javascript:void(0);" onClick={this.handleOpenModal}>
                        <img src={this.props.lockIconPath}></img>
                    </a>
                </div>
            </div>
        )
    }
    componentWillMount() {
        Modal.setAppElement('body');
    }
    render() {
        return(
            <React.Fragment>
                {this.lockRender()}
                {this.state.modalIsOpen && (
                <SubscribePopupComponent 
                    portalClassName={"modal buy_modal __subscribeModal"} 
                    className={""} 
                    overlayClassName={"Overlay"} 
                >
                </SubscribePopupComponent>)}
            </React.Fragment>
        )
    }
}
export default LockComponent;
